function pickFinalLine(text) {
  const lines = (text || "")
    .split(/\r?\n/)
    .map(s => s.trim())
    .filter(Boolean);

  for (let i = lines.length - 1; i >= 0; i--) {
    if (/^FINAL\s*:/i.test(lines[i])) return lines[i];
  }
  return "";
}

const finalLine = pickFinalLine(stdout) || pickFinalLine(stderr);

