const statusEmoji = (st) => {
  st = (st || "").toUpperCase();
  if (st === "SUCCESS") return "‚úÖ";
  if (st === "ALREADY") return "‚úÖ";
  if (st === "FAILED") return "‚ùå";
  return "‚ö™Ô∏è";
