  const cat = (mm[1] || "").trim();
  const st = (mm[2] || "").trim().toUpperCase();
  if (cat) categories[cat] = st;
}

const emojiOf = (st) => {
  if (st === "ON") return "üü¢";
  if (st === "OFF") return "üî¥";
  if (st === "UNKNOWN") return "üü°";
  if (st === "CONFLICT") return "üü†";
  return "‚ö™Ô∏è";
};

const displayName = (cat) => {
  const c = (cat || "").trim().toLowerCase();
  if (c === "apparel") return "Style";
  if (c === "textiles/fabric") return "Fabric";
  if (c === "trims") return "Trim";
  return cat;
};

const categorySummary = Object.keys(categories).length
  ? Object.entries(categories)
      .sort((a, b) => {
        const order = { "apparel": 1, "trims": 2, "textiles/fabric": 3 };
        const ka = (a[0] || "").toLowerCase();
        const kb = (b[0] || "").toLowerCase();
        return (order[ka] || 99) - (order[kb] || 99);
      })
      .map(([k, v]) => `${emojiOf(v)} ${displayName(k)}: ${v}`)
      .join("\n")
  : "";

