function viMsgFromFinal(finalMsg, mode, type) {
  let msg = (finalMsg || "").trim();
  const m = (mode || "").toUpperCase();
  const t = (type || "").toUpperCase();

  // N·∫øu runner ƒë√£ tr·∫£ ti·∫øng Vi·ªát r·ªìi th√¨ d√πng lu√¥n
  if (/[√†√°·∫£√£·∫°ƒÉ√¢ƒë√™√¥∆°∆∞]/i.test(msg)) return msg;

  // M·ªôt s·ªë d·∫°ng ti·∫øng Anh hay g·∫∑p t·ª´ runner c≈©
  // 1) "... executed" => "... th√†nh c√¥ng"
  if (/\bexecuted\b/i.test(msg)) {
    return `${m} ${t} th√†nh c√¥ng`;
  }

  // 2) "... already correct" => ƒë√£ ON/OFF s·∫µn (∆∞u ti√™n theo mode)
  if (/\balready correct\b/i.test(msg)) {
    if (m === "ON")  return `${m} ${t} ƒë√£ ON s·∫µn`;
    if (m === "OFF") return `${m} ${t} ƒë√£ OFF s·∫µn`;
    return `${m} ${t} ƒë√£ ƒë√∫ng s·∫µn`;
  }

  // 3) "... failed (...)" => "... l·ªói: ..."
  // c·ªë g·∫Øng r√∫t g·ªçn reason
  if (/\bfailed\b/i.test(msg)) {
    let reason = "";
    const mr = /(TimeoutException|NoSuchElementException|StaleElementReferenceException|WebDriverException|JavascriptException|Exception)/i.exec(msg);
    if (mr) reason = mr[1];
    else {
      const mcode = /code=([A-Z0-9_]+)/i.exec(msg);
      if (mcode) reason = `code=${mcode[1]}`;
    }
    return reason
      ? `${m} ${t} l·ªói: ${reason}`
      : `${m} ${t} l·ªói`;
  }

  // 4) CHECK (n·∫øu message ch·ªâ l√† "CHECK" hay t∆∞∆°ng t·ª±)
  if (m === "CHECK" && (msg.toUpperCase() === "CHECK" || msg === "")) {
    return t === "ALL" ? "CHECK ALL th√†nh c√¥ng" : `CHECK ${t} th√†nh c√¥ng`;
  }

  // fallback: gi·ªØ nguy√™n msg nh∆∞ng th√™m label n·∫øu msg qu√° ng·∫Øn
  if (!msg) return `${m} ${t}`;
  return msg;
}

// ----- Build answer (pretty + emoji) -----
