  const prettyMsg = viMsgFromFinal(finalMsg, mode, type);
  const lead = `${statusEmoji(finalStatus)} ${finalStatus} | ${prettyMsg}`;

  if (mode === "CHECK" && categorySummary) {
    answer = `${lead}\n\nüìå Tr·∫°ng th√°i:\n${categorySummary}`;
  } else {
    answer = lead;
  }
